"""Epoch Look-up table"""
from astropy.time import Time

def get_date_time(field, colour):
    """ Takes field as a string (e.g. field='99')
        Colour is 'r', 'g', or 'b'
        Returns epoch and obsdate in decimal
    """
    try:
        epoch = fieldInfo[field][colour]['epoch']
        mjd = fieldInfo[field][colour]['mjddate']
        julian = mjd + 2400000.5

        return epoch, julian
    except KeyError:
        return 0, 0

